This was me thinking out loud on IRC earlier, but I thought I'd share it with those who weren't there. &amp;ndash;[[User:Fredddie|Fredddie]][[User talk:Fredddie|Ã¢&#x201E;Ë˜]] 23:57, 19 September 2011 (UTC)
&lt;blockquote&gt;I've thought about how we can improve how our banner handles assessment. What I was thinking was to give the three sections a ratings system.  We would add three parameters to the banner, {{para|RD}}, {{para|Hist}}, and {{para|RJL}} and we'd rate them each 0, 1, or 2.  0 for non-existent, 1 for present, 2 for really good/complete and the assessment would be based on the sum of the three values: 0-1=stub, 2-3=start 4-5=C 6=B.  So, if you have an awesome and complete route description, but no history or RJL, it would be Start-class.&lt;/blockquote&gt;

Obviously anything over a B would be changed by {{para|class}}.  This would, in effect, institute a B-class checklist for the project, but it would also mean a huge undertaking by us to get the entire project reassessed.  Again.  I do think it would be unwise to institute something like this at this time as it would scuttle the stub drive.  Anyway, I'd like your thoughts on this.  Again, I'm '''not''' proposing we do this at this time. &amp;ndash;[[User:Fredddie|Fredddie]][[User talk:Fredddie|Ã¢&#x201E;Ë˜]] 23:57, 19 September 2011 (UTC)

