Thanks to the perseverance of Purplebackpack, three weak, non-notable rivalry articles (Drake-Dayton, Drake-Iowa, and Northern Iowa&amp;ndash;Southern Illinois) have now been deleted.  Thanks to Ute in DC, one weak &quot;classic&quot; article (River City Showdown) has also been deleted.  Per the conversation above, we have already gotten the go-ahead from WP:CFB to submit the [[Crab Bowl Trophy]] for AfD, with the content to be merged to the parent [[Crab Bowl Classic]] article.  Pursuant to Purplebackpack's suggestions, I would now like to get the approval of our fellow CFB editors to submit the following CFB rivalry articles to AfD:

1.  [[AT&amp;T Corps Classic]] &amp;ndash; Not a true rivalry, game only played four times by Army and Texas A&amp;M;

2.  [[Gansz Trophy] &amp;ndash; Again, not a true rivalry between SMU and Navy.  Virtually no significant coverage of the &quot;rivalry&quot; itself per [[WP:GNG]] and [[WP:NSPORTS]], separate and apart from routine coverage of the individual games;

3.  [[Aggie-Eagle Classic]] &amp;ndash; This may be a meaningful rivalry to the participants, but there is virtually no meaningful coverage of the rivalry itself per [[WP:GNG]] and [[WP:NSPORTS]], separate and apart from routine coverage of the individual games;

4.  [[DoehlingÃ¢&#x20AC;&#x201C;Heselton Memorial Trophy]] &amp;ndash; Again, this may be a meaningful rivalry to the participants, but there is virtually no meaningful coverage of the trophy or the rivalry itself per [[WP:GNG]] and [[WP:NSPORTS]], separate and apart from routine coverage of the individual games.

Please provide your comments below with regard to each article suggested for AfD.  If there is a consensus among CFB editors that these &quot;rivalries&quot; are non-notable, we will submit them to AfD, together with the Crab Bowl Trophy for AfD, after content merge.  [[User:Dirtlawyer1|Dirtlawyer1]] ([[User talk:Dirtlawyer1|talk]]) 00:37, 11 December 2011 (UTC)

