I am giving thought to adding episodes to [[Emmy Awards]] templates that are awarded for episode contributions.  I will not do so for awards that are only for single roles in an episode, but for awards representing entire episodes (directing and writing).  The following are the categories that I would modify templates to highlight the closest substitutes that we have for most critically acclaimed episode:
*[[Primetime Emmy Award for Outstanding Directing for a Comedy Series]] (article names episodes starting in 1990)
*[[Primetime Emmy Award for Outstanding Directing for a Drama Series]] (article names episodes starting in 1980)
*[[Primetime Emmy Award for Outstanding Writing for a Drama Series]] (article names episodes starting in 1980)
*[[Primetime Emmy Award for Outstanding Writing for a Comedy Series]] (article names episodes starting in 1980)

I don't think this is necessary for [[Primetime Emmy Award for Outstanding Directing for a Miniseries, Movie or a Dramatic Special]] or [[Primetime Emmy Award for Outstanding Writing for a Miniseries, Movie or a Dramatic Special]]. These are often TV movies and miniseries which actually have [[Primetime Emmy Award for Outstanding Miniseries]] ({{tl|EmmyAward Miniseries}}) and [[Primetime Emmy Award for Outstanding Made for Television Movie]] ({{tl|EmmyAward TelevisionMovie}}). Even though this category is sometimes for an episode of a miniseries, changing these templates would result in some redundancy. 

I don't think this is necessary for [[Primetime Emmy Award for Outstanding Directing for a Variety, Music or Comedy Program]] or [[Primetime Emmy Award for Outstanding Writing for a Variety, Music or Comedy Program]] since episode articles are not common for these.--[[User:TonyTheTiger|TonyTheTiger]] &lt;small&gt;([[User talk:TonyTheTiger|T]]/[[Special:Contributions/TonyTheTiger|C]]/[[User:TonyTheTiger/Antonio Vernon|BIO]]/[[WP:CHICAGO]]/[[WP:FOUR]]) &lt;/small&gt; 06:49, 17 February 2012 (UTC)

