[[File:Flag of SFR Yugoslavia.svg|thumb|left|Presently used on the template, as supported by Side 2: used on the template to represent the Socialist Federal Republic of Yugoslavia, the last recognized state of Yugoslavia before its collapse from 1991 to 1992.]]
[[File:Flags of Yugoslavia.svg|thumb|right|Proposal of Side 2: a template image that portrays the flag of the Kingdom of Yugoslavia alongside the civil flag of the Socialist Federal Republic of Yugoslavia, to represent both states. (Note: the civil flag of the SFRY was chosen because of its length similarity to the Kingdom's flag to create a visually balanced image, if users request the 1:2 length national flag of the SFRY alongside the Kingdom's flag, this will be offered by Side 2.]]
There is a dispute over potential POV of exclusively having the flag of the [[Socialist Federal Republic of Yugoslavia]] (SFRY) as the representative of the WikiProject Yugoslavia does not represent material on the Kingdom of Serbs, Croats, and Slovenes/Kingdom of Yugoslavia from 1918 to the 1940s. Side 1 believes that because the flag of the SFRY was the last flag of a state of Yugoslavia, that it should be used in the template, and has addressed concerns that the plain tricolour flag of the Kingdom of Yugoslavia is a political symbol that represents the Serb-led monarchy and its Serb hegomonic and authoritarian dictatorship after 1929. Side 2 believes that because Yugoslavia is dissolved and that the two states were substantially different that the flag of the Kingdom of Yugoslavia should be used alongside the flag of the SFRY in the template, it notes that both the Kingdom's and the SFRY's flag both can denote authoritarianism and dictatorship, claiming that neither symbol can avoid offense to some group.--[[User:R-41|R-41]] ([[User talk:R-41|talk]]) 17:25, 8 June 2012 (UTC)

