Hi all, I'm not a member of WP:DW, but I've been amusing myself today wandering through the [[Doctor Who (series 3)|Series 3]] articles, and I've noticed what may be systematic copyvios. I'd appreciate it if someone from this project could take a look at the matter and let me know whether I'm missing something (entirely possible) or whether the lead sections of many articles contain blurb text original to BBC. Nearly every episode article for this series has a lead section clearly ''based'' on the BBC blurbs, but some are overwhelmingly blatant copies while others are merely &quot;yeah, it's obvious where they got that&quot;. The worst examples:

*[[Gridlock (Doctor Who)]]: &quot;The Doctor and Martha must brave the ordeal of the mysterious Motorway in order to discover the terrible secrets at the heart of the city.&quot; Description from what appears to be the [http://www.bbcentertainment.com/europe/programmes/doctorwho-s3/episodes/ BBC website]: &quot;[...]they must brave the ordeal of the mysterious Motorway in order to discover the terrible secret at the heart of the city.&quot;
*[[Daleks in Manhattan]]: &quot;In New York City, 1930, in the midst of the Depression, people are disappearing from among the homeless and jobless masses. Pig-like creatures hide in the sewers, and at the bottom of the Empire State Building, some of the Doctor's greatest and oldest enemies, the Daleks, are at work, preparing their most horrific plan yet.&quot; BBC: &quot;In the midst of the Depression, people are disappearing off the streets. Savage Pig Men hide in the sewers and, at the very top of the Empire State Building, The Doctorâ€™s oldest enemies are at work, preparing their most audacious plan yet.&quot;
*[[The Family of Blood]]: &quot;It is 1913 in England and war has come a year in advance as the terrifying Family hunts for the Doctor. But when John Smith refuses to accept his destiny as a Time Lord, the women in his life â€” Martha and Joan â€” have to help him decide.&quot; BBC website: &quot;It is 1913 in England and war has come a year in advance as the terrifying Family hunt for The Doctor. But while John Smith refuses to accept his destiny as a Time Lord, the women in his life â€“ Martha and Joan â€“ have to take terrible measures to save the whole of history.&quot;

Now, I've only checked over Series 3, but if this is indeed a case of systematic copyvio, it's likely all series will need to be checked and cleaned. Can someone explain to me the origin of our leads for these articles? Are they copyvios (problem!), or backwards copyvios (in which the BBC would have copied our text - not our problem)? [[User:Fluffernutter|A fluffernutter is a sandwich!]] ([[User talk:Fluffernutter|talk]]) 20:22, 9 January 2012 (UTC)

