I spent a week in the highlands last month (July 2012), and passed through Duthil while wandering round the region.  I suggest it would be worthwhile augmenting the article (which I consulted to find the etyomology and pronunciation of &quot;Duthil&quot;, but no luck there, though the proper Gaelic gives a guide) with at least the village's most important feature, which is the Clan Grant Centre located in the former village kirk.

I didn't stop to visit it, so its current status is unclear to me (the &quot;official&quot; site at &lt;ref&gt;www.clangrant.org/centre.php&lt;/ref&gt; seems to have disappeared), but there's some information at http://www.clangrant.org/index.aspx?pid=5.

http://www.clangrant-us.org/dutnews.htm offers: &quot;Back in 1985 the dream of a Clan Grant centre in the Strathspey area became real when the of [sic] historic Duthil Kirk in Carrbridge [an error: Carrbridge is a separate village] became available. The kirk building was constructed in 1829 and stands amid the centuries old burial place of Grants. One of the mausoleums contains the remains of the six Chiefs of Grant from 1585 until Caroline, Countess of Seafield, directed that it be permanently closed. In August of 1986 the kirk was turned over to the Clan Grant Heritage Trust in the presence of an audience of Grants from around the world. [Para.]  The United Kingdom (UK) branch of the Clan Grant Society initiated the substantial effort to acquire and renovate the kirk. They have through hard work and dedication achieved this goal for the benefit of the worldwide Clan Grant Societies and indeed for all Grants and septs who look back to Strathspey for their heritage. [Para.]  Sir Patrick Grant of Dalvey is the current Chair of the UK Society and of the effort to bring the kirk up to National Historic Trust standards and develop it as a museum and centre for us, for you, for Clan Grant.&quot;

There's also a Clan Grant Centre Trust, registered as an active charity, at nearby Carrbridge.  An undated note at  http://www.ancestralscotland.com/plan/itineraries/grant/ says that &quot;the Grant Clan centre, housed in the Duthil Kirk ... is currently being developed as a visitor centre by the Clan Grant Society. At the Kirk are the mausoleum and graves of some of the Clan Grant chiefs and the Earls of Seafield.&quot;  http://clangrant.balvack.com/index.aspx?pid=33 tells us that &quot;The annual [Grant] Clan Gathering is held over a weekend in August during the Abernethy Highland Games in Strathspey [, and on] Sunday the AGM is held at the Clan Grant Centre in Duthil&quot;.  http://www.clangrant-us.org/duthil.htm&lt;/ says that &quot;It is expected that the Duthil Kirk Clan Center will be open to visitors in July and August of each year. Currently one of the members of the Clan Grant Society of the U.K., who lives in the area, tries to man the center during the month of August - contact the U.K. society if you will be visiting Grantown and want to know if anyone will be available at the Kirk for visitors.&quot;

Anyone else want to pursue this?

-- donmillion
